(2, 'Chandrayan 3', 'NISAR: NASA-ISRO SAR (NISAR) is a Low Earth Orbit (LEO) observatory being jointly developed by NASA and ISRO.\r\nNISAR will map the entire globe in 12 days and provide spatially and temporally consistent data for understanding changes in Earth’s ecosystems, ice mass, vegetation biomass, sea level rise, ground water and natural hazards including earthquakes, tsunamis, volcanoes and landslides.\r\nGaganyaan: Gaganyaan mission aims to send humans to space and return them safely to Earth. The mission will consist of two unmanned flights and one manned flight, using the GSLV Mk III launch vehicle and a human-rated orbital module.\r\nThe manned flight will carry three astronauts, including a woman, for up to seven days in low Earth orbit.\r\n', '2023-09-05', 1, 'Sanskar', 'Sanskar', 'bbztEGZwmDWJ3JQ', );
INSERT INTO `news_description` (`News_ID`, `News_name`, `About_News`, `news_date`, `news_catagory`, `Editor_name`, `Reporter_name`, `Image_id`, `Image_data`) VALUES
(3, 'About Isro', 'The Indian Space Research Organisation (ISRO /ˈɪsroʊ/)[a] is the national space agency of India. It operates as the primary research and development arm of the Department of Space (DoS), which is directly overseen by the Prime Minister of India, while the Chairman of ISRO also acts as the executive of DoS. ISRO is primarily responsible for performing tasks related to space-based operations, space exploration, international space cooperation and the development of related technologies.[1] ISRO is one of the six government space agencies in the world that possesses full launch capabilities, can deploy cryogenic engines, can launch extraterrestrial missions and operate a large fleet of artificial satellites.[2][3][b] ISRO is one of the four government space agencies to have soft landing (uncr', '2023-09-02', 1, 'Sanskar', 'Sanskar', 'i66BNpAeIOgy8DN', );
INSERT INTO `news_description` (`News_ID`, `News_name`, `About_News`, `news_date`, `news_catagory`, `Editor_name`, `Reporter_name`, `Image_id`, `Image_data`) VALUES
(4, 'Wikipedia', 'Wikipedia[note 3] is a free-content online encyclopedia written and maintained by a community of volunteers, collectively known as Wikipedians, through open collaboration and using a wiki-based editing system called MediaWiki. Wikipedia is the largest and most-read reference work in history,[3][4] and has consistently been one of the 10 most popular websites.[5] Founded by Jimmy Wales and Larry Sanger on January 15, 2001, it is hosted by the Wikimedia Foundation, an American nonprofit organization.\r\n\r\nInitially only available in English, versions in other languages were quickly developed. Wikipedia\'s combined editions comprise more than 61 million articles, attracting around 2 billion unique device visits per month and more than 15 million edits per month (about 5.8 edits per second', '2023-09-06', 7, 'Sanskar', 'Sanskar', 'tcpVJedyCDehUaV', );
INSERT INTO `news_description` (`News_ID`, `News_name`, `About_News`, `news_date`, `news_catagory`, `Editor_name`, `Reporter_name`, `Image_id`, `Image_data`) VALUES
(5, 'Youtube', 'YouTube is an American online video sharing and social media platform headquartered in San Bruno, California, United States. Accessible worldwide,[7] it was launched on February 14, 2005, by Steve Chen, Chad Hurley, and Jawed Karim. It is owned by Google and is the second most visited website, after Google Search. YouTube has more than 2.5 billion monthly users,[8] who collectively watch more than one billion hours of videos each day.[9] As of May 2019, videos were being uploaded at a rate of more than 500 hours of content per minute.[10][11]\r\n\r\nIn October 2006, YouTube was bought by Google for $1.65 billion.[12] Google\'s ownership of YouTube expanded the site\'s business model, expanding from generating revenue from advertisements alone to offering paid content such as movies and exclusive', '2023-09-06', 3, 'Sanskar', 'Sanskar', 'RtTO7fsXUsc3BiP', );
INSERT INTO `news_description` (`News_ID`, `News_name`, `About_News`, `news_date`, `news_catagory`, `Editor_name`, `Reporter_name`, `Image_id`, `Image_data`) VALUES
(6, 'Spotify', 'Spotify (/ˈspɒtɪfaɪ/; Swedish: [ˈspɔ̂tːɪfaj]) is a Swedish[6] audio streaming and media services provider founded on 23 April 2006 by Daniel Ek and Martin Lorentzon.[7] It is one of the largest music streaming service providers, with over 551 million monthly active users, including 220 million paying subscribers, as of June 2023.[4][8] Spotify is listed (through a Luxembourg City-domiciled holding company, Spotify Technology S.A.[1]) on the New York Stock Exchange in the form of American depositary receipts.\r\n\r\nSpotify offers digital copyright restricted recorded audio content, including more than 100 million songs and five million podcasts, from record labels and media companies.[8] As a freemium service, basic features are free with advertisements and limited control, while additional features, such as offline listening and commercial-free listening, are offered via paid subscriptions. Users can search for music based on artist, album, or genre, and can create, edit, and share playlists.\r\n\r\nSpotify is available in most of Europe, as well as Africa, the Americas, Asia, and Oceania, with a total availability in 184 markets.[9] Its users and subscribers are based largely in the US and Europe, jointly accounting for around 53% of users and 67% of revenue.[10] It has no presence in mainland China where the market is dominated by QQ Music. The service is available on most devices, including Windows, macOS, and Linux computers, iOS and Android smartphones and tablets, smart home devices such as the Amazon Echo and Google Nest lines of products, and digital media players like Roku.[11]\r\n\r\nUnlike physical or download sales, which pay artists a fixed price per song or album sold, Spotify pays royalties based on the number of artist streams as a proportion of total songs streamed. It distributes approximately 70% of its total revenue to rights holders (often record labels), who then pay artists based on individual agreements.[12]', '2023-09-15', 7, 'BOT', 'BOT', 'KYAXi9lKlmMpdJh', );

